import React from 'react';
import { useNavigate } from 'react-router-dom';
import { FaSearch, FaShoppingCart, FaUser } from 'react-icons/fa';
import './FeaturedPage.css';

const FeaturedPage = () => {
  const navigate = useNavigate();

  const featuredCategories = [
    {
      id: 1,
      title: 'Fresh Fruits',
      image: 'https://images.unsplash.com/photo-1610832958506-aa56368176cf?w=500&auto=format'
    },
    {
      id: 2,
      title: 'Fresh Vegetables',
      image: 'https://images.unsplash.com/photo-1542838132-92c53300491e?w=500&auto=format'
    },
    {
      id: 3,
      title: 'Kitchen Equipment',
      image: 'https://images.unsplash.com/photo-1556911220-e15b29be8c8f?w=500&auto=format'
    },
    {
      id: 4,
      title: 'Cleaning Supplies',
      image: 'https://images.unsplash.com/photo-1563453392212-326f5e854473?w=500&auto=format'
    }
  ];

  return (
    <div className="featured-page">
      <nav className="navbar">
        <div className="nav-left">
          <button className="back-button" onClick={() => navigate('/home')}>â€¹</button>
          <ul className="nav-links">
            <li><a onClick={() => navigate('/clothes')}>Clothes</a></li>
            <li><a onClick={() => navigate('/gadgets')}>Gadgets</a></li>
            <li><a onClick={() => navigate('/new')}>New</a></li>
            <li><a onClick={() => navigate('/featured')}>Featured</a></li>
            <li><a onClick={() => navigate('/barter')}>Barter</a></li>
          </ul>
        </div>

        <div className="nav-center">
          <h1>TECHSELL</h1>
        </div>

        <div className="nav-right">
          <button className="icon-button"><FaSearch /></button>
          <button className="icon-button"><FaShoppingCart /></button>
          <button className="icon-button user-profile" onClick={() => navigate('/profile')}><FaUser /></button>
        </div>
      </nav>

      <div className="marketplace-content">
        <h2>Your Marketplace</h2>
        <div className="category-grid">
          {featuredCategories.map(category => (
            <div key={category.id} className="category-card">
              <img src={category.image} alt={category.title} />
              <div className="category-overlay">
                <h3>{category.title}</h3>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default FeaturedPage;
